import React from "react";
import PostCardStyleHome from "./Cards/PostCardStyleHome";

function NewsGrid({
  editorPackSectionDatas,
  editorPackSectionDatas1,
  editorPackSectionDatas2,
  editorPackSectionDatas3,
  dataLength = "2",
  gridClasses = "col-lg-3 col-md-6",
}) {
  return (
    <div className="row g-0">
      <div key={editorPackSectionDatas.category_id} className={gridClasses}>
        <PostCardStyleHome
          datas={{image: editorPackSectionDatas.image, category: "Technology", date: editorPackSectionDatas.date, title: editorPackSectionDatas.title, user: editorPackSectionDatas.user,}}
        />
      </div>
      <div key={editorPackSectionDatas.category_id} className={gridClasses}>
        <PostCardStyleHome
          datas={{image: editorPackSectionDatas.image, category: "Technology", date: editorPackSectionDatas.date, title: editorPackSectionDatas.title, user: editorPackSectionDatas.user,}}
        />
      </div>
      <div key={editorPackSectionDatas.category_id} className={gridClasses}>
        <PostCardStyleHome
          datas={{image: editorPackSectionDatas.image, category: "Technology", date: editorPackSectionDatas.date, title: editorPackSectionDatas.title, user: editorPackSectionDatas.user,}}
        />
      </div>
      <div key={editorPackSectionDatas.category_id} className={gridClasses}>
        <PostCardStyleHome
          datas={{image: editorPackSectionDatas.image, category: "Technology", date: editorPackSectionDatas.date, title: editorPackSectionDatas.title, user: editorPackSectionDatas.user,}}
        />
      </div>
    </div>
  );
}

export default NewsGrid;
